package com.cleanwise.service.apps.edi;import com.americancoders.edi.*;/** code to parse 810 transaction *<br>class 810 Advanced Ship Notice *<br> *@author Deping */public class Inbound810_XPEDX extends Inbound810Super{		private static String[] excludedProductionSKUs = {"686017", "686018"};	private static String[] excludedTestSKUs = {"688101", "688100"};	public Inbound810_XPEDX(){		distSkuType = "VP";			}	/**	 * Extract all segments included in ST - SE Segment	 */	public void extract()	throws OBOEException	{		excludedSKUs = this.getTranslator().getProfile().getTestIndicator().equals("T") ? 				excludedTestSKUs : excludedProductionSKUs;		super.extract();	}}